import React from "react";
import axios from "axios";

function App() {

  api =  "https://brianiswu-cat-facts-v1.p.rapidapi.com/facts"

  async function fetchData() {
    const fetchedData = axios.get(api);
    return fetchedData;
  }

  console.log(fetchData());

  return(
    <h1>
      Hello World!
    </h1>
  )
};

export default App;
